import React from 'react';
import Header from './components/Header'
import './App.css'
import Navbar from "./components/Navbar";
import Profile from "./components/Profile";

function App() {
    return (
        <div className='container'>
            <Header/>
            <Navbar/>
            <Profile/>
        </div>
    )
}

export default App;
